import React from 'react';
import Box from '@mui/material/Box';
import { DataGrid } from '@mui/x-data-grid';
import { useNavigate } from 'react-router-dom';
import { FormControl, MenuItem, Select, InputLabel, SxProps, Theme, SelectChangeEvent } from '@mui/material';
import { Button } from '@mui/material';
import { productsPageMockData } from '../MockData/ProductsPage';
import backgroundImage from './background.avif';


export default function ProductsPage() {

  const wholeContainer : SxProps<Theme> = {
    overflow:'auto',
    minWidth:'800px',
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: 'cover', 
    backgroundPosition: 'center', 
    minHeight: '100vh',
  }
  const boxContainer : SxProps<Theme> = {
    height: '40vh', 
    maxHeight: '70vh', 
    overflowY: 'auto', 
  }
  const buttonContainer : SxProps<Theme> = {
    display:'flex',
    border: '1px',
    borderRadius: '8px',
    padding: '30px',
    marginBottom: '30px',
  }
  const container: SxProps<Theme> = {
    minHeight: '40vh',
    display: 'flex',
    border: '1px',
    marginTop: '10px',
    justifyContent: 'space-between',
    flexWrap: 'wrap',
  };

  const addShopsButton: SxProps<Theme> = {
    '&.addShopsBut.MuiButton-contained': {
      paddingRight: '10px',
      marginRight: '10px',
    }
  };

  const button1: SxProps<Theme> = {
    marginRight:'5px'
  };

  const searchButton: SxProps<Theme> = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    minHeight: '20vh', 
  };

  const body : SxProps<Theme> = {
    display: 'flex',
    flexDirection:'column', 
    padding: '10px', 
    alignItems:'center',
    marginTop:'300px'
  }

  const generateMenuItems = () => {
    return productsPageMockData.tables[0].products.map((product)=>(
        <MenuItem>
        <span>{product.name}</span>
        </MenuItem>
    ))
  }

  return (
    <Box sx = {wholeContainer}>

    <Box sx={body}>

    </Box>

      <Box sx = {searchButton}><Button variant="contained">SUBMIT</Button></Box>

    </Box>
  );
}
